import React from 'react';
import {Link} from "react-router-dom";

function Header() {
    return (
        <nav>
            <Link to="/"> Accueil </Link>
            <Link to="/survey/42" > Questionnaires </Link>
            <Link to="/freelance"> Freelance</Link>
         </nav>
    );
}

export default Header;
